import React, { Component } from "react";
import PostData from "../data/db.json";
import CardList from "../CardList.js";

const PostList = () => {
  return (
    <div>
      {PostData.cards.map((items, index) => {
        return;
        <CardList props={items.title} />;
      })}
    </div>
  );
};

export default PostList;
